import React from 'react';
import {Link} from 'react-router-dom';
import './navbar.css';
const Navbar = () => (

    <nav className='navbar'>
        <ul>
            <li>
                <Link to="/articleslist"><a>Articles</a></Link>
            </li>
            <li>
                <Link to="/about">About</Link>
            </li>
            <li>
                <Link to="/">Home</Link>
            </li>
        </ul>
    </nav>
);
export default Navbar;
